If a node has the same attribute defined in grid and in define, the value in grid will overwrite the one in define: grid { src("Source", connect: e:w@e), dest; dest("Custom destination", shape: rect);
} define { src(shape: square, connect: {s:n@s, e:w@e}); dest("Destination", shape: circle);
} Example 3 As an example of where this can come in handy, say we wanted all block nodes connect to the node below them except for the last one. This can be achieved by overriding its connect to an empty list: grid { block("Step one"); block("Step two"); block("Step three"); block("Step four", connect: {});
} define { block(shape: ellipse, class: "pink", connect: s:n@s);
