Let's write a custom CSS file called index.css that will modify the default CSS as well as target the custom CSS classes we attached to our nodes and connections: /* Override default CSS */
.background { fill: #cec;
} /* Custom classes */
.my-destination .node { fill: lightpink;
} .my-destination text { fill: #333;
} .my-south-connection .path,
.my-south-connection .arrowhead { fill: blue; stroke: blue;
} We can use the --css CLI option to embed one or more CSS files into the resulting SVG: $ flou input.svg -o output.svg --css index.css This is the result: Example 2

