Since text is the most commonly used attribute, it has a convenient shorthand. We could use the following form and get the same result: grid { block("Hello World!", shape: rect);
} When using the text shorthand, the text string needs to be the first element of the attribute list. For example, this is invalid: grid { block(shape: rect, "Hello World!");
} Rectangle is the default node shape, so we could also omit the shape attribute: grid { block("Hello World!");
}
